window.bookSummaryJSON = "<p><b>Armed with his magical branding iron and his devoted harem of monster girls, William has freed the lands of Solanna and is ready to lead its people in a final battle against the vile sorcerer at the heart of Etria's troubles.</b></p> <p>But it won’t be easy. To save Etria, he’ll have to get past a giant blood red wall of doom that is slowly expanding to engulf the world, defeat an endless army of the hungry dead, and storm the sorcerer's ziggurat fortress full of monsters and traps.</p> <p>Fortunately, William has one last trick up his sleeve. And if it works, well, let’s just say that sorcerer can kiss his ass good-bye.</p>"; 
